import "./App.css";
import { Route } from "react-router";
import BackgroundVideo from './image/'

import Home from "./components/Home";

function App() {
  return (
    <div className="App">
      <video
        id="background-video"
        autoplay
        loop
        muted
        poster="https://assets.codepen.io/6093409/river.jpg"
      >
        <source
          src="https://assets.codepen.io/6093409/river.mp4"
          type="video/mp4"
        />
      </video>
      <Home />
    </div>
  );
}

export default App;
